import React from 'react';
import './Header.css';
import { Link } from 'react-router-dom';
import Navigation from '../Navigation/Navigation.js';
import logoMain from '../../images/logo-white.svg';
import logo from '../../images/logo-dark.svg';

function Header({ loggedIn, pathname }) {
    return (
        <header className={`header ${pathname === "/" ? "header_type_main" : "header_type_saved-news"}`}>
            <Link to="/"><img className="header__logo" src={`${pathname === "/" ? logoMain : logo}`} alt="Логотип" /></Link>
            <Navigation
                loggedIn={loggedIn}
                pathname={pathname}
            />
        </header>
    )
}

export default Header;
